import React, { Component } from 'react';
import data from './Dropdown.json';
import Option from './Button/Option';
class DropDown extends Component {
    render() {
        let elememt = data.map((data,index) => (
            <Option 
                key = {index}
                option={data.option}
            />
            )
            )
        return (

            <select className="form-control filter">
                <option>{this.props.select}</option>
                {elememt}
            </select>
        );
    }
}

export default DropDown;
